    <script src="JS/gsap.min.js"></script>
    <script src="JS/anim.js"></script>
    <script src="https://cdnjs.cloudflare.com/ajax/libs/gsap/3.9.1/CSSRulePlugin.min.js"></script>
    <script>
        document.addEventListener("DOMContentLoaded", function () {
            const homeIndicator = CSSRulePlugin.getRule(".menu-item p#home::after");
            const toggleButton = document.querySelector(".burger");
            let isOpen = false;

            gsap.set(".menu-item p", { y: -255 });
            const timeline = gsap.timeline({ paused: true });

            timeline.to(".overlay", {
                duration: 1.5,
                clipPath: "polygon(0% 0%, 100% 0%, 100% 100%, 0% 100%)",
                ease: "power4.inout"
            });

            timeline.to(".menu-item p", {
                duration: 1,
                y: 0,
                stagger: 0.2,
                ease: "power4.out"
            }, "-=1");

            timeline.to(homeIndicator, {
                width: "100%",
                duration: 1,
                ease: "power4.out",
                delay: 0.5
            }, "<");

            timeline.to(".sub-nav", {
                bottom: "5%",
                opacity: 1,
                duration: 0.5,
                delay: 0.5
            }, "<");

            toggleButton.addEventListener("click", function () {
                if (isOpen) {
                    timeline.reverse().then(() => {
                        isOpen = false;
                        toggleButton.classList.remove('home');
                    });
                } else {
                    timeline.play().then(() => {
                        isOpen = true;
                        toggleButton.classList.add('home');
                    });
                }
            });
        });
    </script>
